const express = require('express');
const app = express();
const ejs = require('ejs');
const path = require('path');
const fs = require('fs');

// Set the views directory and the view engine
app.set('views', path.join(__dirname, 'views'));
app.set('view engine', 'ejs');

// Define the route for the directory listing
app.get('/list/:dir(*)', (req, res) => {
  // Get the directory path from the URL parameter
  const dirPath = path.join(__dirname, req.params.dir);

  // Check if the directory exists
  if (fs.existsSync(dirPath)) {
    // Read the contents of the directory
    const files = fs.readdirSync(dirPath);

    // Create an array to hold the nested list data
    const listData = [];

    // Iterate over each file/folder in the directory
    files.forEach(file => {
      // Construct the full path to the file/folder
      const filePath = path.join(dirPath, file);

      // Check if the item is a directory
      if (fs.statSync(filePath).isDirectory()) {
        // Recursively call this function to get the nested list of the subdirectory
        const nestedList = getNestedList(filePath);

        // Add the nested list data to the current item
        listData.push({ name: file, type: 'directory', items: nestedList });
      } else {
        // Add the file data to the current item
        listData.push({ name: file, type: 'file' });
      }
    });

    // Render the EJS template with the nested list data
    res.render('list', { dirPath, listData });
  } else {
    // If the directory does not exist, return a 404 error
    res.status(404).send('Directory not found');
  }
});

// Define the function to recursively get the nested list of a directory
function getNestedList(dirPath) {
  // Read the contents of the directory
  const files = fs.readdirSync(dirPath);

  // Create an array to hold the nested list data
  const nestedList = [];

  // Iterate over each file/folder in the directory
  files.forEach(file => {
    // Construct the full path to the file/folder
    const filePath = path.join(dirPath, file);

    // Check if the item is a directory
    if (fs.statSync(filePath).isDirectory()) {
      // Recursively call this function to get the nested list of the subdirectory
      const subList = getNestedList(filePath);

      // Add the nested list data to the current item
      nestedList.push({ name: file, type: 'directory', items: subList });
    } else {
      // Add the file data to the current item
      nestedList.push({ name: file, type: 'file' });
    }
  });

  // Return the nested list data
  return nestedList;
}

// Start the server on port 3000
app.listen(3000, () => console.log('Server started on port 3000'));
```

This program defines a route `/list/:dir(*)` that takes a directory path as a parameter and returns a webpage with a nested list of files and folders in that directory. The `getNestedList()` function is used to recursively scan the directory and construct the nested list data. The EJS template `views/list.ejs` is used to render the webpage with the nested list data.

Note: This program assumes that the directory being scanned is a local directory on the server running the Node.js application. If you want to scan a directory on a remote server or from a client-side web application, you will need to modify the program accordingly.

To create a new Electron application, you can follow these steps:

1. Install Node.js and npm (Node Package Manager) if they are not already installed on your system.

2. Open a new terminal window and run the following command to install the Electron package globally:
```
npm install -g electron
```

3. Create a new directory for your application and navigate to it in the terminal:

```
mkdir my-electron-app
cd my-electron-app
```

4. Run the following command to create a new package.json file in your project directory:
```
npm init -y
```

5. Install the Electron package as a development dependency:
```
npm install electron --save-dev
```

6. Create a new file called "main.js" in your project directory. This file will contain the main process code for your application.

7. Add the following code to your main.js file to create a basic Electron application:

```
const { app, BrowserWindow } = require('electron')

function createWindow () {
  const win = new BrowserWindow({
    width: 800,
    height: 600,
    webPreferences: {
      nodeIntegration: true
    }
  })

  win.loadFile('index.html')
}

app.whenReady().then(() => {
  createWindow()

  app.on('activate', () => {
    if (BrowserWindow.getAllWindows().length === 0) {
      createWindow()
    }
  })
})

app.on('window-all-closed', () => {
  if (process.platform !== 'darwin') {
    app.quit()
  }
})
```

8. Create a new file called "index.html" in your project directory. This file will contain the HTML and CSS code for your application's user interface.

